import ImageOne from '../public/images/one.jpg';
import ImageTwo from '../public/images/twoo.jpg';
import ImageThree from '../public/images/three.jpg';

export const SliderData = [
    {
        title: 'Luxury Villa in Bali, Indonesia',
        price: '$4,280,000',
        path: '/homes',
        label: 'View Home',
        image: ImageOne,
        alt: 'House'
    },
    {
        title: 'Luxury Villa in Indonesia',
        price: '$4,000',
        path: '/homes',
        label: 'View Home',
        image: ImageTwo,
        alt: 'House'
    },
    {
        title: 'li, Indonesia',
        price: '$00',
        path: '/homes',
        label: 'View Home',
        image: ImageThree,
        alt: 'House'
    },
]
